import React, { Component } from 'react';

class Navbar extends Component {

    render() {
        return(
            <div className="navbar">
                <ul>
                    <li><a href="#home"></a>Home</li>
                    <li><a href="#about"></a>About</li>
                    <li><a href="#contact"></a>Contact</li>
                </ul>
            </div>
        );
    }

}

export default Navbar;
